import {NavLink} from "react-bootstrap";

function Header() {
    return (
        <Navbar bg={"dark"} variant={"dark"} className={'navbar-padding'}>
            <NavLink to="/" className={'item'}>
                Cours React
            </NavLink>
            <NavLink to="/todo" className={'item'}>
                Todo
            </NavLink>
        </Navbar>
    )
}

export default Header;
